const response = Axios.post(`${process.env.REACT_APP_SERVER_URL}/check-user`);

ReactDOM.render(
  <React.StrictMode>
    <App user={response.data.userEmail} loggedIn={response.data.loggedIn} />
  </React.StrictMode>,
  document.getElementById("root")
);

